import React, { Component } from 'react';
import '../css/personalizationgrid.css'

class PersonalizationGrid extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const imgUrl = new URL(this.props.Image);
        const categories = [
            {
                img: "",
                text: "Sociedade"
            },
            {
                img: "",
                text: "Moda"
            },
            {
                img: "",
                text: "Casa"
            },
            {
                img: "",
                text: "Opinião"
            },
            {
                img: "",
                text: "Pessoas"
            },
            {
                img: "",
                text: "Economia"
            },
            {
                img: "",
                text: "Cultura"
            },
            {
                img: "",
                text: "Desporto"
            },
            {
                img: "",
                text: "Artes"
            }];
        return (
            <div className="row">
                {
                    categories.map(category=>{
                    return <div className="col-4">{category.text}</div>
                    })
                }
            </div>
        )
    }

}

export default PersonalizationGrid;
